def a(s, k):
    return s[-k:]

def b(s, k):
    return s[:k]


def overlap_graph(strings, k):
    adj = []

    for i in range(len(strings)):
        for j in range(len(strings)):
            if i != j: 
                ai = a(strings[i][1], k)  
                bj = b(strings[j][1], k)  
                if ai == bj:
                    adj.append((strings[i][0], strings[j][0]))  

    return adj

